import Persondetails from './components/persondetails/Persondetails';
import './style/global.css'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";


function App() {
    return(
        <div className="App">
             <Sidebar/>
             <div className="container">
                <Header/>
                <Main/>
                <Persondetails/>
            </div>
        </div>
    );
}

export default App;
